import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'StudentRegisterClient';
}
<h1>Made with Angular</h1>
<router-outlet>
  <app-student-data-container></app-student-data-container>
</router-outlet>
